import Form from './styles/Form';

export default function SignIn() {
  return (
    <Form method="POST">
      <fieldset>
        <label htmlFor="emai">
          Email
          <input
            type="email"
            name="email"
            placeholder="Email Address"
            autoComplete="email"
            // value
            // onChange
          />
        </label>
        <label htmlFor="password">
          Password
          <input
            type="email"
            name="email"
            placeholder="Email Address"
            autoComplete="email"
            // value
            // onChange
          />
        </label>
      </fieldset>
    </Form>
  );
}
